import React, { useEffect, useState } from 'react'
import axios from 'axios'
import HomeItems from '../components/HomeItems'
import { useDispatch, useSelector } from 'react-redux'
import { APIROUTE } from '../components/Commonroute'
import { hideloading, showloading } from '../store/cartSlice'
//http://localhost:8000/api/items/getallitems
const Homepage = () => {
    const [allitems, setAllitems] = useState([])
    const [selectedcategory, setselectedcategory] = useState('fruits')
    const dispatch = useDispatch()
    const { loading } = useSelector(state => state.cartState)
    const categories = [
        { name: 'fruits', image: 'data:image/jpeg;base64,' },
        { name: 'vegetables', image: 'data:image/jpeg;base64,' },
        { name: 'meat', image: 'data:image/jpeg;base64,' }
    ]
    const getallitems = async () => {
        dispatch(showloading())
        await axios.get(`${APIROUTE}items/getallitems`)
            .then(res => {
                //console.log(res.data)
                setAllitems(res.data)
                dispatch(hideloading())
            })
            .catch(err => {
                console.log(err)
                dispatch(hideloading())
            })
    }
    useEffect(() => {
        getallitems()

    }, [])
    return (
        <div className=''>
            <div className='d-flex gap-3 my-3'>
                {categories && categories.map((cat, idx) => (
                    <div onClick={()=>setselectedcategory(cat.name)}
                     className={` cat-border d-flex  justify-content-center gap-2 ps-3 ${selectedcategory===cat.name && 'selected-cat-border'}`} >
                        <p className='h4'>{cat.name}</p>
                        <img src={cat.image} alt='' height={60} width={80}/>
                    </div>
                ))}
            </div>
            <div className='row'>
                {allitems && allitems.filter((i)=>i.category===selectedcategory).map((item, idx) => (
                    <HomeItems item={item} key={idx}/>
                ))}
            </div>

        </div>
    )
}

export default Homepage